import "./cliente.css";
import FormDialog from "../dialog/dialog";
import React from 'react';
import Axios from "axios";

export default function Cliente(props) {
  const [open, setOpen] = React.useState(false);
  const [editValues, setEditValues] = useState({
    nome: props.nome,
    email: props.email,
    telefone: props.telefone,
  });

  const handleClickCliente = () => {
    setOpen(true);
  }

  const handleDeleteButton = () => {
    Axios.delete(`http://localhost:3001/delete/${editValues.id}`).then(() => {
      props.setListCliente(
        props.listCliente.filter((value) => {
          return value.id !== editValues.id;
        })
      );
    });
    handleClose();
  }

  return (
    <>
      <FormDialog
        open={open}
        setOpen={setOpen}
        nome={props.nome}
        email={props.email}
        telefone={props.telefone}
        listCliente={props.listCliente}
        setListCliente={props.setListCliente}
      />
      <div className="conteudo-lista-cliente" /*</>onClick={() => handleClickCliente()}*/>
        <p>{props.nome}</p>
        <p>{props.email}</p>
        <p>{props.telefone}</p>
        <button className="botao-excluir" onClick={() => { handleDeleteButton() }}>Excluir</button>
      </div>
    </>
  );
}
